import axios from 'axios'
import React, { useEffect, useState } from 'react'

export default function Posts (props) {

    const [data, setdata] = useState([])

    useEffect(() => {
        axios.get(`https://jsonplaceholder.typicode.com/${props.component}`)
            .then((res) => {
                console.log(res.data);
                setdata(res.data)
            })
    }, [props.component])

    return (
        <div className='text-center bg-secondary mt-5'>
          
            <section className='row justify-content-around'>
                {
                    data.map((ele, ind) => {
                        return ele.userId == props.userId ?
                            <div className='card bg-warning col-5 mb-5' key={ind}>
                                <h1>userID = {ele.userId}</h1>
                                <h1> <span className='text-danger'>{props.component}</span> id =  {ele.id}</h1>
                                <h1> <span className='text-danger'>{props.component}</span> title =  {ele.title}</h1>
                                {
                                    ele.body ? <h1> <span className='text-danger'>{props.component}</span> body =  {ele.body}</h1> : null
                                }
                            </div>
                        : null
                    })
                }

            </section>
        </div>
    )
}
